import { Typography } from "@mui/material";
import Box from "@mui/material/Box"
import Paper from "@mui/material/Paper";
import { ReceiverListContext } from "../../State Management/ReceiverListContext";
import { useContext } from "react";


export const DeviceBig = () => {
    const deviceList = useContext(ReceiverListContext);

    // Check if deviceList is loaded
    if (!deviceList) {
      return <div>Loading devices...</div>;
    }

    return (
      <Box>
        {deviceList.map((device, index) => (
          <Paper key={index} style={{ margin: '10px', padding: '10px' }}>
            <Typography variant="h6">Device Name: {device.name}</Typography>
            <Typography variant="h6">IP Address: {device.ipAddress}</Typography>
            {/* Assuming 'ping' is a property you want to display */}
            {/* If it's not available in the data, you'll need to adjust accordingly */}
            <Typography variant="h6">Ping: NA</Typography> 
          </Paper>
        ))}
      </Box>
    );
  }
